  render: () => {
    const NOW_IN_MS = new Date().getTime();
    const ONE_DAY_IN_MS = 1000 * 60 * 60 * 24;

    // Values in minutes
    const demo1Data = [7, 5, 3, 5, 8, 0.5, 3, 3, 14, 1];
    const demo2Data = [2, 7, 8, 7, 3, 0.5, 7, 3, 5, 1];
    const demo3Data = [3, 1, 3, 5, 4, 0.5, 3, 1, 3.5, 1];
    const buckets = [...Array(10)].map((_, i) => {
      return {
        label: new Date(NOW_IN_MS - ONE_DAY_IN_MS * i).toISOString(),
        data: [{
          datasetName: 'Session',
          value: demo1Data[9 - i]
        }, {
          datasetName: 'Session',
          value: demo2Data[9 - i]
        }, {
          datasetName: 'Session',
          value: demo3Data[9 - i]
        }]
      };
    }).reverse();
    return <ThemeProviderWrapper>
        <CustomChartComponent chartConfiguration={{
        graphType: 'stackedBar',
        metricsCards: [{
          title: 'Avg. User Sessions',
          metricScope: 'bucket',
          dataType: 'number'
        }, {
          title: 'Avg. Session Duration',
          metricScope: 'period',
          dataType: 'duration'
        }],
        chartOptions: {
          hiddenLegend: true,
          yAxisOptions: 'duration'
        }
      }} chartData={{
        datasets: [{
          name: 'Session',
          hue: 'purple'
        }],
        cardValues: [5.68, 19 * 60 + 2 // Value in seconds
        ],
        buckets
      }} />
      </ThemeProviderWrapper>;
  }
